import React, { useState, useEffect } from 'react'
import { useHistory, useRouteMatch } from 'react-router-dom'

function EntetyTable(props) {
    let history = useHistory()
    let match = useRouteMatch();
    const [entitys, setentitys] = useState([])
    const manupilateEntitysData = () => {
        let obj
        let newdata = {}
        // let expressions
        for (let i = 0; i < props.entitys.length; i++) {
            obj = {
                [props.entitys[i]['type']]: {
                    id: props.entitys[i]['id'],
                }
            }
            newdata = { ...newdata, ...obj }

        }
        setentitys(Object.keys(newdata))
    }
    useEffect(() => {
        manupilateEntitysData()
    }, [])
    return (

        entitys.map(el => <tr key={el}>
            <td onClick={() => history.push(`${match.path}/add/${el}`)} style={{ cursor: 'pointer' }}>{el}</td>
            <td></td>
            <td>{props.entitys.filter(element => element.type == el).length}</td>
        </tr>)

    )
}

export default EntetyTable
